import React from 'react';
import Fetch from 'isomorphic-unfetch';

const Root = ({ products }) => {
  console.log('props: ', products);
  return (
    <div>
      <h1>Test</h1>
      <div className="grid">
        {products.map((a) => (
          <div key={a.id}>
            <div>{a.name}</div>
            <div>{a.producer}</div>
            <div>{a.ean}</div>
            <div>{a.price}</div>
            <div>{a.ceneoPrice}</div>
          </div>
        ))}
      </div>
      <style jsx>{`
        .grid {
          background: yellow;
        }
      `}</style>
    </div>
  );
};

Root.getInitialProps = async () => {
  const res = await Fetch('http://localhost:1000');
  const jsonData = await res.json();

  console.log(jsonData);

  return {
    products: jsonData,
  };
};

export default Root;
